import React, { Component } from 'react'
import Articulo from "../pages/Articulo"
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid'

export default function FormRow(articulos) {
    const useStyles = makeStyles({
        card: {
            padding: '8px',
            textAlign: 'center',
            maxWidth: 345,
        },
        media: {
            height: 160,
        },
      });

    const articule={
        id: 1000,
        titulo: "Error en formrow",
        descripcion: "No pasaron 3 articulos",
        url: "",
        image:""
      }
    var articles = articulos
    
        return (
            articulos.map((articulo)=>(
              <React.Fragment>
                
                <Grid item xs={4} spacing={3}>
                  <Articulo articulo={articulo} ver={articulo.ver} estilo={useStyles}/>
                </Grid>
                
              </React.Fragment>
            )
        ))

            
    
}
